class Solution:

    def maxProduct(self,A):
        max_ending_here = max_so_far = 1
        for x in A:
            if x > 0:
                max_ending_here = max(1,max_ending_here*x)
            else:
                max_ending_here = max(x,max_ending_here * x)
                max_so_far = max(max_so_far, max_ending_here)
        return max_so_far




