class Solution_1:
    # @param A, a list of integers
    # @return an integer
    def maxProduct(self, A):
        length = len(A)
        max_prod = - float('inf')
        for i in range(0,length):
            j = 1
            while i + j <= length:
                array = A[i:j+i]
                prod = self.prod(array)
                max_prod = max(max_prod,prod)
                #print max_prod
                j += 1
        return max_prod

    def prod(self,B):
        product = 1
        for i in B:
            product = product * i
        return product

